/**
 * eslint-disable @typescript-eslint/no-unused-vars
 *
 * @format
 */

import { useClockStyles } from './styles';

/**
 * eslint-disable @typescript-eslint/no-unused-vars
 *
 * @format
 */

/**
 * eslint-disable @typescript-eslint/no-unused-vars
 *
 * @format
 */

/** @format */

const Clock = () => {
	const classes = useClockStyles();
	return (
		<section>
			<p className={classes.time}> 10:28PM WAT </p>
		</section>
	);
};

export default Clock;
